import { Component, OnInit, TemplateRef} from '@angular/core';
import { NgForm } from '@angular/forms';
import { BsModalService, BsModalRef, ModalOptions } from 'ngx-bootstrap/modal';
import jsPDF from 'jspdf';
import * as moment from 'moment'

import { Aluno } from 'src/app/model/Aluno';
import { Contrato } from 'src/app/model/Contrato';
import { RelatorioParcial } from 'src/app/model/RelatorioParcial';
import { ContratoService } from 'src/app/service/contrato.service';
import { AlunoService } from 'src/app/service/aluno.service';
import { RelatoriosAlunoMediator } from 'src/app/mediators/RelatoriosAlunoMediator';
import { RelatoriosService } from 'src/app/service/relatorios.service';

@Component({
  selector: 'app-relatorio-parcial',
  templateUrl: './relatorio-parcial.component.html',
  styleUrls: ['./relatorio-parcial.component.css']
})
export class RelatorioParcialComponent implements OnInit {

  constructor(private contratoService: ContratoService, private alunoService: AlunoService, private relatorioService: RelatoriosService, private modalService: BsModalService) { }
  seisMeses: number = 182;
  aluno: Aluno = new Aluno();
  contrato: Contrato = new Contrato();
  relatorioParcial: RelatorioParcial = new RelatorioParcial();
  relatoriosAlunoMediator: RelatoriosAlunoMediator = new RelatoriosAlunoMediator();
  modalPosReq: BsModalRef;
  mensagemPosReq: String;

  imgData = "data:image/jpeg;base64,";

  dataAtual = new Date();
  dataPeriodoInicio: string;
  dataPeriodoFim: string;

  ngOnInit() {
    this.relatorioParcial.atividadesAuxiliadas = " ";
    this.relatorioParcial.dificuldades = " ";
    this.relatorioParcial.motivosNao = " ";
    this.dataPeriodoInicio = moment(this.dataAtual).format('DD/MM/YYYY');
    this.dataPeriodoFim = moment(this.dataAtual.setDate(this.dataAtual.getDate() + this.seisMeses)).format('DD/MM/YYYY');

    this.alunoService.buscaPorId().subscribe(
      aluno => {
        this.aluno = aluno;

        this.carregaContratoDoAluno();

      },
      err =>{
        alert(err.error.message);
      }
    );
  }

  carregaContratoDoAluno(){
    this.contratoService.buscaPorAluno(this.aluno).subscribe(
      contrato => {
        this.contrato = contrato;
      },
      err =>{
        alert(err.error.message);
      }

    );
  }

  salvarRelatorioParcial(template: TemplateRef<any>, form: NgForm){

    this.relatoriosAlunoMediator.aluno = this.aluno;
    this.relatoriosAlunoMediator.relatorioParcial = this.relatorioParcial;
    this.relatoriosAlunoMediator.relatorioParcial.periodoDe = new Date();

    this.relatorioService.salvarRelatorioParcial(this.relatoriosAlunoMediator).subscribe(

      sucess => {
        this.mensagemPosReq = 'Relatório Parcial cadastrado com sucesso.'
        this.modalPosRequisicao(template);
        
      },
      err => {
        this.mensagemPosReq = err.error.message;
        this.modalPosRequisicao(template);
      });

  }

  modalPosRequisicao(template: TemplateRef<any>){
    const config: ModalOptions = { class: 'modal-md' }
    this.modalPosReq = this.modalService.show(template, config);
  }

  limpar(form: NgForm){
    form.reset();
    this.ngOnInit();
  }

  imprimirRelatorioParcial(){
    
    var lMargin=15; //left margin in mm
    var rMargin=15; //right margin in mm
    var pdfInMM=210;  // width of A4 in mm
    var pageCenter=pdfInMM/2;
    
    var doc = new jsPDF("p","mm","a4");
    doc.addImage(this.imgData, 'PNG', 15, 5, 180, 25);
    doc.setFont("Arial");
    doc.setFontStyle("bold");
    doc.setFontSize(18);

    // Variáveis
    var titulo_relatorio = "RELATÓRIO PARCIAL SEMESTRAL";
    var subtitulo = "Lei 11.788/08 Art. 7°"
    var sim = "Sim";

    //Cabeçalho
    doc.text(doc.splitTextToSize(titulo_relatorio, (pdfInMM-lMargin-rMargin)),pageCenter,39,'center');
    doc.setFontSize(11);
    doc.text(doc.splitTextToSize(subtitulo, (pdfInMM-lMargin-rMargin)),pageCenter,44,'center');

    //Retângulos - (x, y, largura, linha) x = distancia horizontal, y = distancia vertical
    doc.rect(10, 50, 90, 8);
    doc.rect(100, 50, 100, 8);
    doc.rect(10, 58, 90, 8);
    doc.rect(100, 58, 100, 8);
    doc.rect(10, 66, 190, 8);
    doc.rect(10, 74, 190, 8);
    doc.rect(10, 82, 190, 8);
    doc.rect(10, 90, 190, 8);
    doc.rect(10, 98, 190, 21);
    doc.rect(10, 119, 190, 8);
    doc.rect(10, 127, 190, 8);
    doc.rect(10, 135, 190, 8);
    doc.rect(10, 143, 190, 8);
    doc.rect(10, 151, 190, 8);
    doc.rect(10, 159, 190, 8);
    doc.rect(10, 167, 190, 21);
    doc.rect(10, 188, 190, 21);
    doc.rect(10, 209, 190, 21);

    
    doc.text("Estagiário(a):", 12, 55);
    doc.text(this.aluno.nome, 36, 55);
    doc.text("RA:", 103, 55);
    doc.text(this.aluno.ra, 111, 55);
    doc.text("Curso:", 12, 63);
    doc.text(this.aluno.curso, 24, 63);
    doc.text("Período:", 103, 63);
    doc.text(this.aluno.periodo, 118, 63);
    doc.text("Entidade Concedente:", 12, 71);
    doc.text(this.contrato.empresa.razaoSocial, 51, 71);
    doc.text("Supervisor(a) de Estágio:", 12, 79);
    doc.text(this.contrato.supervisorEstagio, 56, 79);
    doc.text("Vigência do Estágio:", 12, 87);
    doc.text(moment(this.contrato.dataFim).format('DD/MM/YYYY'), 48, 87);
    doc.text("Período de Avaliação:", 12, 95);
    doc.text("De: " + this.dataPeriodoInicio + " Até: " + this.dataPeriodoFim, 50, 95);
    doc.text("Atividades auxiliadas no estágio de acordo com o termo de compromisso de estágio:", 12, 103);
    doc.text(this.relatorioParcial.atividadesAuxiliadas, 12, 107);
    doc.text("ATIVIDADES REALIZADAS NO ESTÁGIO", 12, 124);
    doc.text("Estão de Acordo com o plano de atividades ?", 12, 132);
    doc.text(this.relatorioParcial.acordoPlanoAtividades == true ? "Sim" : "Não", 150, 132);
    doc.text("São compatíveis com o curso ?", 12, 140);
    doc.text(this.relatorioParcial.compativelCurso == true ? "Sim": "Não", 150, 140);
    doc.text("São compatíveis com o semestre cursado ?", 12, 148);
    doc.text(this.relatorioParcial.compativelSemestre == true ? "Sim": "Não", 150, 148);
    doc.text("Permite que aplique o conhecimento obtido no curso ?", 12, 156);
    doc.text(this.relatorioParcial.conhecimentoObtido == true ? "Sim": "Não", 150, 156);
    doc.text("As instalações da parte concedente são adequadas à realização do estágio ?", 12, 164);
    doc.text(this.relatorioParcial.instalacoesAdequadas == true ? "Sim": "Não", 150, 164);
    doc.text("Quando assinalado NÃO, justifique os motivos:", 12, 172);
    doc.text(this.relatorioParcial.motivosNao, 12, 176)
    doc.text("Apresente as dificuldades encontradas na realização do estágio:", 12, 193);
    doc.text(this.relatorioParcial.dificuldades, 12, 197)
    doc.text("Considerações do Supervisor(a) de Estágio:", 12, 214);
    doc.text("Sorocaba,", 125, 238);
    doc.text("de", 155, 238);
    doc.text("de 20", 185, 238);
    doc.text("____________________________________", 12, 260);
    doc.text("Estagiário(a):", 12, 265);
    doc.text("____________________________________", 100, 260);
    doc.text("Supervisor(a):", 100, 265);
    doc.text("____________________________________", 12, 280);
    doc.text("Coordenador(a) do curso/ Orientador(a) de Estágio", 12, 285);

    doc.output("dataurlnewwindow");
  }
}
